import './Toolbar.css';

const SideMenu = () => {
  return (
    <>
    <div>
      <div className="toolbar-left"></div>
      <div className='fd-clearbox'>
        <div className="header">
        <a className='title'>
          Toolbar
        </a>
        </div>
      </div>
      </div>
    </>
  );
};

export default SideMenu;
